import React, { Component } from 'react';
import { Text, TextInput, StyleSheet } from 'react-native';

export class AddInput extends Component {
    render() {
        return (
            <>
                <TextInput
                    placeholder="escriba aqui"
                    style={styles.input}
                ></TextInput>
            </>
        )
    }
}

const styles = StyleSheet.create({
    input: {
        borderColor: "black"
    }
})
